import React ,{Component} from 'react';
 import { Navbar, Nav } from 'react-bootstrap';
 import {Button} from 'react-bootstrap';
 import {Form} from 'react-bootstrap';
 import {FormControl} from 'react-bootstrap';
 import {NavLink} from 're'

class Home extends Component {
    render() {
        return (
            <div className="App">
            <br />
            <Navbar bg="primary" variant="dark">
              <Navbar.Brand href="#home">Library Management System</Navbar.Brand>
              <Nav className="mr-auto">
                <NavLink to='/add-book'>
                <Nav.Link href="#addbook">Add Books</Nav.Link></NavLink>
                <Nav.Link href="#updatebook">Update Books</Nav.Link>
                <Nav.Link href="#deletebook">Delete</Nav.Link>
              </Nav>
              <Form inline>
                <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                <Button variant="outline-light">Search</Button>
              </Form>
            </Navbar>
          
           <img src={process.env.PUBLIC_URL +"/download.jpg"}
           alt="mypic"
           width="1200"
           /> 

          </div>

        );
    }
}
 export default Home;
